import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="Feed">
      <Navbar />
    </div>
  )
}

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <img src="https://images.vexels.com/media/users/3/137201/isolated/preview/83b5f2a86fa0ec9f938664da94a9bc55-instagram-silhouette-stroke-logo-by-vexels.png" alt="navbar logo" height="100px" width="200px"></img>
      </div>
    )
  }
}

export default App;
